def fibonacciSum(n):
    total_sum = 1
    (a, b) = (1, 1)
    while a < n:
        if (a % 3 == 0 or a % 5 == 0) and (a % 10 == 3 or a % 10 == 7):
            total_sum += a
        (a, b) = (b, a + b)
    return total_sum

